}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">  <rect x="0.5" y="0.5" width="15" height="15" transform="translate(16 16) rotate(-180)" fill="#fff" stroke="#787878" stroke-miterlimit="10"/>  <polyline points="4.19 6.563 6.541 9.224 12.001 2.714" fill="none" stroke="#787878" stroke-miterlimit="10"/>  <polyline points="4.094 10.338 6.445 12.998 11.906 6.489" fill="none" stroke="#787878" stroke-miterlimit="10"/></svg>';
